THE DA VINCI CODE

The Da Vinci Code is a 2003 mystery-detective novel written by American author Dan Brown and published by the Doubleday Group in the United States and Bantam Books in the United Kingdom. It follows symbologist Robert Langdon as he investigates a murder in Paris&amp;#039;s Louvre Museum and discovers a battle between the Priory of Sion and Opus Dei over the possibility of Jesus Christ of Nazareth having been married to and fathering a child with Mary Magdalene.

